window.$=HTMLElement.prototype.$=function(selector){
    var elems=(this==window?document:this).querySelectorAll(selector);
    return elems.length==0?null:elems.length==1?elems[0]:elems;
};
window.onload=function(){
    Auto();
};
window.onresize=function(){
    Auto();
    if($(".svrs_title")){titleFixedToTop();}
};
window.onscroll=function(){
    if($(".svrs_title")){titleFixedToTop();}
    if(getScrollTop()>(parseInt($('#banner').style.height))){$('#banner>a').style.display="block";}else{
    $('#banner>a').style.display="none";}
};
//获取cookie
var nGenre=0
var nProduct=0
function fCok(){
    var reg1=/genre=/
    var reg2=/product=/
    var sCok=document.cookie;
    if(reg1.test(sCok))nGenre=sCok[reg1.exec(sCok).index+6];
    if(reg2.test(sCok))nProduct=sCok[reg2.exec(sCok).index+8];
}

//点击传入cookie
function fClick(aLis){
    for(var i=0;i<aLis.length;i++){
        aLis[i].onclick=function(){
            document.cookie='genre='+this.getAttribute('data-i');
            document.cookie='product='+0;
            window.open('productdetail.html');
        }
    }
}

//页面尺寸
function Auto(){
    var width=document.documentElement.clientWidth;
    if(width<1400){
        $('body').style.width="1400px";
        $('#banner').style.height="700px";
    }else {
        $('body').style.width=width+"px";
        $('#banner').style.height="700px";
    }
}

//下拉定位
function titleFixedToTop(){
    var titleTop = getScrollTop();
    var title = $(".svrs_title");
    if(titleTop>(parseInt($('#banner').style.height)+86))
    {
        title.style.position = "fixed";
        title.style.top="0";
        title.style.leftBtn="0";
        title.style.zIndex = "111";
        title.style.opacity="0.9"
    }else{
        title.style.position = "";
    }
}

//获取滚动条距离顶端的距离
function getScrollTop() {
    var scrollPos;
    if(window.pageYOffset){
        scrollPos = window.pageYOffset;
    }
    else if(document.compatMode && document.compatMode != 'BackCompat')
    {
        scrollPos = document.documentElement.scrollTop;
    }
    else if(document.body)
    {
        scrollPos = document.body.scrollTop;
    }
    return scrollPos;
}

