function fIndexClick(){
    $('#sec_top_ul').addEventListener('click',function(e){
        var et= e.target;
        var lis=$('#sec_top_ul>ol>li')[0].$('li');
        while(et.tagName!="LI"){
            et=et.parentElement;
        }
        for(var i=0;i<lis.length;i++){
            if(lis[i]==et){break;}
        }
        document.cookie='genre='+$('#sec_top_span .hover').getAttribute('data-i')
        document.cookie='product='+i;
        window.open('productdetail.html');//打开详情页
    })
}

