function fNew(){
    //获取鼠标滑过和点击的标签和要切换的内容元素
    var titles=$('.svrs_title').getElementsByTagName('li');
    // alert(titles.length)
    var divs=$('#content .nr');
    //alert(divs.length)
    if (titles.length!=divs.length)
        return;
    //遍历titles下所有的li
    for (var i=0;i<titles.length;i++)
    {
        titles[i].index=i;
        titles[i].onclick=function(){
            //清除所有li上的class
            for (var j=0;j<titles.length;j++)
            {
                titles[j].className='';
                divs[j].style.display='none';
            }
            //设置当前高龄显示
            this.className="select";
            divs[this.index].style.display='block';
        }
    }
}













